import React, { useState } from 'react'

function AddSynonym(props) {
    const [synonym, setSynonym] = useState('')
    return (
        <form onSubmit={(e) => {
            e.preventDefault();
            let obj = {
                entity: {
                    content: props.content,
                    synonyms: synonym
                },
                idEntity: props.entityId,
                idChildren: props.childrenId
            }

            props.handelSubmitSynonym(e, obj)
            e.currentTarget.reset()
            props.close()
        }} style={{ padding: "50px" }}>
            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Synonym</label><br /><br />
            <input className="addSyn" type="text" onChange={(e) => setSynonym(e.target.value)} required /><br /><br />

        </form>
    )
}

export default AddSynonym
